import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { User, Lock, Eye, EyeOff, AlertCircle, Zap } from 'lucide-react';

const LoginPage = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [showPassword, setShowPassword] = useState(false);
    const [error, setError] = useState('');
    const [isLoading, setIsLoading] = useState(false);
    const navigate = useNavigate();

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
        setIsLoading(true);

        try {
            const response = await fetch('http://localhost:3001/api/login', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ username, password })
            });

            const data = await response.json();

            if (response.ok) {
                // Store user info in localStorage
                localStorage.setItem('user', JSON.stringify(data.user));
                localStorage.setItem('userEmail', data.user.email);

                // Redirect to feedback page
                navigate('/feedback');
            } else {
                setError(data.error || 'Login failed');
            }
        } catch (error) {
            setError('Network error. Please try again.');
        } finally {
            setIsLoading(false);
        }
    };

    const handleUsernameChange = (e) => {
        setUsername(e.target.value);
        if (error) setError('');
    };

    const handlePasswordChange = (e) => {
        setPassword(e.target.value);
        if (error) setError('');
    };

    return (
        <div className="min-h-screen bg-white">
            {/* Header */}
            <header className="px-6 py-4 flex justify-between items-center">
                <div className="text-xl font-bold text-gray-900">Font Evaluator</div>
                <nav className="flex space-x-6 text-sm text-gray-600">
                    <a href="#" className="hover:text-gray-900 transition-colors">Learn more</a>
                    <a href="#" className="hover:text-gray-900 transition-colors">Support</a>
                    <a href="#" className="hover:text-gray-900 transition-colors">Sign In</a>
                </nav>
            </header>

            {/* Main Content */}
            <div className="flex flex-col items-center justify-center min-h-[calc(100vh-80px)] px-6">
                {/* Illustration */}
                <div className="mb-8 relative">
                    <div className="w-80 h-80 bg-gray-50 rounded-lg border-2 border-dashed border-gray-300 flex items-center justify-center relative overflow-hidden">
                        {/* Background Elements */}
                        <div className="absolute top-4 left-4 w-16 h-16 bg-yellow-200 rounded-full opacity-60"></div>
                        <div className="absolute top-8 right-8 text-blue-400 text-2xl font-bold">+++</div>
                        <div className="absolute bottom-8 left-8 text-blue-400 text-xl font-bold">++</div>

                        {/* Four Figures */}
                        <div className="grid grid-cols-2 gap-8 w-full h-full p-8">
                            {/* Top Left */}
                            <div className="flex flex-col items-center">
                                <div className="w-12 h-12 bg-gray-300 rounded-full mb-2 flex items-center justify-center">
                                    <span className="text-xs font-bold">Tt</span>
                                </div>
                                <div className="w-8 h-8 bg-gray-200 rounded-full mb-1"></div>
                                <div className="w-6 h-4 bg-gray-200 rounded"></div>
                            </div>

                            {/* Top Right */}
                            <div className="flex flex-col items-center">
                                <div className="w-12 h-12 bg-gray-300 rounded-full mb-2 flex items-center justify-center">
                                    <span className="text-xs font-bold">A</span>
                                </div>
                                <div className="w-8 h-8 bg-gray-200 rounded-full mb-1"></div>
                                <div className="w-6 h-4 bg-gray-200 rounded"></div>
                            </div>

                            {/* Bottom Left */}
                            <div className="flex flex-col items-center">
                                <div className="w-12 h-12 bg-gray-300 rounded-full mb-2 flex items-center justify-center">
                                    <span className="text-xs font-bold">!,"</span>
                                </div>
                                <div className="w-8 h-8 bg-gray-200 rounded-full mb-1"></div>
                                <div className="w-6 h-4 bg-gray-200 rounded"></div>
                            </div>

                            {/* Bottom Right */}
                            <div className="flex flex-col items-center">
                                <div className="w-12 h-12 bg-gray-300 rounded-full mb-2 flex items-center justify-center">
                                    <span className="text-xs font-bold">&lt;/&gt;</span>
                                </div>
                                <div className="w-8 h-8 bg-gray-200 rounded-full mb-1"></div>
                                <div className="w-6 h-4 bg-gray-200 rounded"></div>
                            </div>
                        </div>
                    </div>
                </div>

                {/* Content */}
                <div className="text-center max-w-md">
                    <h1 className="text-3xl font-bold text-gray-900 mb-4">Welcome to the Font Evaluator</h1>
                    <p className="text-gray-600 mb-8">Evaluate prompts and their results with AI-powered font recommendations.</p>

                    {/* Login Form */}
                    <div className="bg-white border border-gray-200 rounded-lg p-6 shadow-sm">
                        <form onSubmit={handleSubmit} className="space-y-4">
                            <div>
                                <label htmlFor="username" className="block text-sm font-medium text-gray-700 mb-1 text-left">
                                    Username
                                </label>
                                <input
                                    type="text"
                                    id="username"
                                    value={username}
                                    onChange={handleUsernameChange}
                                    className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors"
                                    placeholder="Enter your username"
                                    required
                                    disabled={isLoading}
                                />
                            </div>

                            <div>
                                <label htmlFor="password" className="block text-sm font-medium text-gray-700 mb-1 text-left">
                                    Password
                                </label>
                                <div className="relative">
                                    <input
                                        type={showPassword ? 'text' : 'password'}
                                        id="password"
                                        value={password}
                                        onChange={handlePasswordChange}
                                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors pr-10"
                                        placeholder="Enter your password"
                                        required
                                        disabled={isLoading}
                                    />
                                    <button
                                        type="button"
                                        onClick={() => setShowPassword(!showPassword)}
                                        className="absolute right-2 top-1/2 transform -translate-y-1/2 text-gray-400 hover:text-gray-600 transition-colors"
                                        disabled={isLoading}
                                    >
                                        {showPassword ? <EyeOff size={14} /> : <Eye size={14} />}
                                    </button>
                                </div>
                            </div>

                            {error && (
                                <div className="flex items-center space-x-2 text-red-600 text-sm bg-red-50 p-3 rounded-md border border-red-200">
                                    <AlertCircle size={14} />
                                    <span>{error}</span>
                                </div>
                            )}

                            <button
                                type="submit"
                                disabled={isLoading}
                                className="w-full bg-blue-600 hover:bg-blue-700 disabled:bg-blue-400 text-white font-medium py-2 px-4 rounded-md transition-colors flex items-center justify-center space-x-2"
                            >
                                {isLoading ? (
                                    <>
                                        <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white"></div>
                                        <span>Signing in...</span>
                                    </>
                                ) : (
                                    <>
                                        <span>Sign In</span>
                                        <Lock size={14} />
                                    </>
                                )}
                            </button>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default LoginPage;
